import React from 'react';

class TableList extends React.Component{

   render() {
      const listItems = this.props.datatList.map((d) => <li key={d._id}>{d.name}</li>);

      return(
         <div>
            <h2>Table List</h2>
            {listItems }
         </div>
      )
   }
}

export default TableList;
